import {Link} from "react-router-dom"

const Navbar = ()=>{
    return (
        <nav>
            <div class="title tooltip">GetIntern</div>
            
            <ul class="navbar">
                <Link to="/">Home</Link>
                <Link to="/interns">Available Internships</Link>
                <Link to="/new-intern">Add Internship</Link>
            </ul>
        </nav>
    );
}

export default Navbar;
